    cap = cv2.VideoCapture(
        '/Users/falli_ot/Desktop/P3-HJ1 (ArUco)/project.avi')  # Due to an unknown reason the file was converted to .avi format
    augDict = loadAugImages('../CVAPR_Project/markers')
