    ws = wb['mocap_ref_data']  # Work Sheet
    xColumn = ws['C']
    yColumn = ws['D']
    zColumn = ws['E']
    mocapXCoordinates = [xColumn[x].value for x in range(len(xColumn))]
    mocapYCoordinates = [yColumn[x].value for x in range(len(yColumn))]
    mocapZCoordinates = [zColumn[x].value for x in range(len(zColumn))]

    mocapReversedXCoordinates = []
    mocapReversedYCoordinates = []
    mocapReversedZCoordinates = []

    cameraIntrinsics = np.array(
        [[1854, 0, 1920],
         [0, 1854, 1080],
         [0, 0, 1]], dtype=np.float32)

    # Check if the video capture is open
    if (cap.isOpened() == False):
        print("Error opening video file")

    while (cap.isOpened()):
        # Read frame:
        ret, frame = cap.read()
        if ret == True:
            arucoFound = findArucoMarkers(frame)

            # Loop through all the markers and augment each one
            if len(arucoFound[0]) != 0:
                for markerCorner, markerId in zip(arucoFound[0], arucoFound[1]):
                    # extract the marker corners (which are always returned in
                    # top-left, top-right, bottom-right, and bottom-left order)
                    corners = markerCorner.reshape((4, 2))
                    (topLeft, topRight, bottomRight, bottomLeft) = corners

                    # convert each of the (x, y)-coordinate pairs to integers
                    topRight = (int(topRight[0]), int(topRight[1]))
                    listOfRightCorners.append(topRight)
                    listOfIds.append(int(markerId))
                    frame = augmentAruco(markerCorner, markerId, frame)

            cv2.imshow("Drone recording", frame)

            # End of frame
            for markerId in listOfIds:
                coordinate = getExistingMarkers(markerId, listOf3DCoordinates)
                if coordinate != None:
                    listOfExisting3DCoordinates.append(coordinate)

            points2D = np.array(listOfRightCorners, dtype=np.float32)
            points3D = np.array(listOfExisting3DCoordinates, dtype=np.float32)

            if len(points3D) < 4:
                print("Not enought data to calculate the position")
            else:
                print("Calculating...")
                if len(points2D) == len(points3D) and len(points3D) >= 6:
                    success, rotation_vector, translation_vector = cv2.solvePnP(points3D, points2D, cameraIntrinsics, None)

                    rotM = cv2.Rodrigues(rotation_vector)[0]
                    cameraPosition = -np.matrix(rotM).T * np.matrix(translation_vector)
                    listOfDroneXCoordinates.append(cameraPosition.flat[0])
                    listOfDroneYCoordinates.append(cameraPosition.flat[1])
                    listOfDroneZCoordinates.append(cameraPosition.flat[2])

            if markerId in listOfIds:
                listOfIds.clear()
                listOfRightCorners.clear()
                listOfExisting3DCoordinates.clear()
            if cv2.waitKey(25) == ord('q'):
                print("exit")
                break
        else:
            print("break")
            break
    cap.release()
    cv2.destroyAllWindows()
    print("END")

